/* @flow */
import * as React from 'react'



type Props = {
  type: string
}

const List = (props: Props): React.Element<*> => {

    const list = props.menuitems;

    const updatedList = list.map((listItems)=>{
        return <li>{listItems}</li>;
    });

    return(
        <ul>{updatedList}</ul>
    );
}

List.defaultProps = {
  type: ''
}

export default List;
